import React from 'react'
import image from "../home/mexico.jpg"
import "../../../src/index.css"

function Home() {
  return (
    <div>
      <section className="hero is-medium is-info is-bold">
        <img className="background-video" src={image} alt="mexico" />

          <h4>Asistencia para las emergencias de tu auto en donde estés</h4>
          <h6>Carfix está para apoyarte con las principales emergencias de tu auto como:</h6>
          <p> Cambio de llanta de refacción</p>
          <p >Paso de corriente a batería</p>
          <p >Servicio de grúa</p>
          <p >Abasto de combustible</p>
      </section>
    </div>
  );
}

export default Home;
